    Data memory result = data_[_roundId];
    return (
      result.roundId,
      result.answer,
      result.timestamp,
      result.roundTimestamp,
      result.answeredInRound
    );
  }

  function latestRoundData() external view 
  returns (
      uint80 roundId,
      int256 answer,
      uint256 startedAt,
      uint256 updatedAt,
      uint80 answeredInRound
    ) {
    Data memory result = data_[currentRoundId_];
    return (
      result.roundId,
      result.answer,
      result.timestamp,
      result.roundTimestamp,
      result.answeredInRound
    );
  }
}

